class Solution:
    def maxOperations(self, s: str) -> int:

        count = 0 

        n = len(s)

        zeros = 0
        ones = 0

        for i in range(n):

            if s[i] == '1':

                if zeros: 
                    count += ones 
                ones += 1
                zeros = 0 
                continue 
            zeros += 1

        if zeros: 
            count += ones

        return count







